import React, { useState, useEffect } from 'react';
import { useNavigate, Link } from 'react-router-dom';
import axios from 'axios';

const porteOptions = ['pequeno','medio','grande'];
const sexoOptions  = ['macho','femea'];

export default function NovoPet() {
  const navigate = useNavigate();
  const [form, setForm] = useState({
    nome: '',
    especie: 'Cachorro',
    raca: '',
    idade: '',
    peso: '',
    porte: 'pequeno',
    sexo: 'macho',
    cor: '',
    castrado: false,
    carteiraVacinacao: false,
    tutor: '',
    dono: '',
    criador: '',
    observacoes: ''
  });
  const [tutores, setTutores] = useState([]);
  const [donos, setDonos] = useState([]);
  const [admins, setAdmins] = useState([]);
  const [erro, setErro] = useState(null);

  useEffect(() => {
    axios.get('/api/tutores').then(r => setTutores(r.data));
    axios.get('/api/donos').then(r => setDonos(r.data));
    axios.get('/api/admin').then(r => setAdmins(r.data));
  }, []);

  const handleChange = e => {
    const { name, value, type, checked } = e.target;
    setForm(f => ({
      ...f,
      [name]: type==='checkbox' ? checked : value
    }));
  };

  const handleSubmit = async e => {
    e.preventDefault();
    try {
      await axios.post('/api/pets', {
        ...form,
        idade: Number(form.idade),
        peso: Number(form.peso)
      });
      navigate('/pets');
    } catch (err) {
      setErro(err.response?.data?.erro || 'Erro ao cadastrar pet');
    }
  };

  return (
    <div className="container my-5">
      <h2>Cadastrar Novo Pet</h2>
      <Link to="/pets" className="btn btn-link mb-3">← Voltar à Lista</Link>
      {erro && <div className="alert alert-danger">{erro}</div>}
      <form onSubmit={handleSubmit}>
        {/** Nome **/}
        <div className="mb-3">
          <label className="form-label">Nome</label>
          <input
            name="nome"
            className="form-control"
            value={form.nome}
            onChange={handleChange}
            required
          />
        </div>
        {/** Raça **/}
        <div className="mb-3">
          <label className="form-label">Raça</label>
          <input
            name="raca"
            className="form-control"
            value={form.raca}
            onChange={handleChange}
            required
          />
        </div>
        {/** Idade e Peso **/}
        <div className="row">
          <div className="col mb-3">
            <label className="form-label">Idade (anos)</label>
            <input
              type="number"
              name="idade"
              className="form-control"
              value={form.idade}
              onChange={handleChange}
              required
            />
          </div>
          <div className="col mb-3">
            <label className="form-label">Peso (kg)</label>
            <input
              type="number"
              step="0.1"
              name="peso"
              className="form-control"
              value={form.peso}
              onChange={handleChange}
              required
            />
          </div>
        </div>
        {/** Porte e Sexo **/}
        <div className="row">
          <div className="col mb-3">
            <label className="form-label">Porte</label>
            <select
              name="porte"
              className="form-select"
              value={form.porte}
              onChange={handleChange}
            >
              {porteOptions.map(p => (
                <option key={p} value={p}>{p}</option>
              ))}
            </select>
          </div>
          <div className="col mb-3">
            <label className="form-label">Sexo</label>
            <select
              name="sexo"
              className="form-select"
              value={form.sexo}
              onChange={handleChange}
            >
              {sexoOptions.map(s => (
                <option key={s} value={s}>{s}</option>
              ))}
            </select>
          </div>
        </div>
        {/** Cor **/}
        <div className="mb-3">
          <label className="form-label">Cor</label>
          <input
            name="cor"
            className="form-control"
            value={form.cor}
            onChange={handleChange}
            required
          />
        </div>
        {/** Castrado e Carteira **/}
        <div className="form-check mb-3">
          <input
            type="checkbox"
            name="castrado"
            id="castrado"
            className="form-check-input"
            checked={form.castrado}
            onChange={handleChange}
          />
          <label htmlFor="castrado" className="form-check-label">
            Castrado
          </label>
        </div>
        <div className="form-check mb-3">
          <input
            type="checkbox"
            name="carteiraVacinacao"
            id="vacina"
            className="form-check-input"
            checked={form.carteiraVacinacao}
            onChange={handleChange}
          />
          <label htmlFor="vacina" className="form-check-label">
            Carteira de Vacinação em Dia
          </label>
        </div>
        {/** Relações **/}
        <div className="mb-3">
          <label className="form-label">Tutor</label>
          <select
            name="tutor"
            className="form-select"
            value={form.tutor}
            onChange={handleChange}
            required
          >
            <option value="">— selecione —</option>
            {tutores.map(t => (
              <option key={t._id} value={t._id}>{t.nome}</option>
            ))}
          </select>
        </div>
        <div className="mb-3">
          <label className="form-label">Dono</label>
          <select
            name="dono"
            className="form-select"
            value={form.dono}
            onChange={handleChange}
            required
          >
            <option value="">— selecione —</option>
            {donos.map(d => (
              <option key={d._id} value={d._id}>{d.nome}</option>
            ))}
          </select>
        </div>
        <div className="mb-3">
          <label className="form-label">Criador (Admin)</label>
          <select
            name="criador"
            className="form-select"
            value={form.criador}
            onChange={handleChange}
            required
          >
            <option value="">— selecione —</option>
            {admins.map(a => (
              <option key={a._id} value={a._id}>{a.nome}</option>
            ))}
          </select>
        </div>
        {/** Observações **/}
        <div className="mb-3">
          <label className="form-label">Observações</label>
          <textarea
            name="observacoes"
            className="form-control"
            rows="3"
            value={form.observacoes}
            onChange={handleChange}
          />
        </div>
        <button type="submit" className="btn btn-primary">
          Cadastrar Pet
        </button>
      </form>
    </div>
  );
}
